import './App.css';
import React, {useState}  from "react";
import './App.css'
import 'antd/dist/antd.css'
import './index.css'
import InputBox from './component/Input'
import {Button, PageHeader, Radio} from "antd";
import OutputBox from "./component/output";
import RadioBox from "./component/Radio";



function App() {
  return (
    <div className="App">
      <div>
          <div className="App-header">
              <PageHeader>
                  <div className="Header-Name">
                      Content Analyzer
                  </div>

              </PageHeader>
          </div>

          <div className="Control-line">
              {/* eslint-disable-next-line react/jsx-no-undef */}
              <RadioBox/>
          </div>

          <div className="ContentBox">
              <InputBox className="Inbox">
              </InputBox>
              <OutputBox className="Outbox"/>
          </div>
          <div className="Analyze-Button-Line">
              <Button>Summary</Button>

          </div>

      </div>


    </div>
  );
}

export default App;
